// UserIcon.js
import React from 'react';
import Avatar from '@mui/material/Avatar';

const UserIcon = ({ name, email, onClick, showDetails }) => {
  const initials = name
    .split(' ')
    .map((word) => word[0])
    .join('');

  return (
    <div style={{ display: 'flex', alignItems: 'center' }}>
      <Avatar onClick={onClick}>{initials}</Avatar>
      {showDetails && (
        <div style={{ marginLeft: '16px' }}>
          <p>Name: {name}</p>
          <p>Email: {email}</p>
        </div>
      )}
    </div>
  );
};

export default UserIcon;
